INSERT INTO `cache_field` VALUES ('field:node:1','a:3:{s:4:\"body\";a:1:{s:3:\"und\";a:1:{i:0;a:5:{s:5:\"value\";s:1690:\"<p>Topics covered included HTTP requests, basic HTML, basic CSS, and web design concepts. Synthesis with course took the form of a \"Getting to Know You\" activity.\r\n</p>\r\n<p>Juraj and I designed this class to meet from 12:50 to 2:20 Mon, Wed and reconvene for our digital lab from 2:30 to 4 on Wednesdays only. Classes began on Wednesday this semester, so our first day of class was a lab day. From 12:50 to 2:20, we did some stage setting but mainly spent the block talking about the syllabus, course policies, assignments, and all that good housekeeping material a conscientious teacher must address early and repeat often. As a result, we came to lab without much grasp on any of the course material. \r\n</p>\r\n<p>\r\nMy itinerary looked like this:\r\n</p>\r\n<p>\r\n2:30-2:50 <a href=\"http://www.slideshare.net/mjlavin80/html-45801099\">Slideshow</a> on the basics of protocols (HTTP, FTP, etc.), HTML, CSS<br/>\r\n2:50-3:20	Self-guided practice, Codecademy tutorial on “Building a Website” <br/>\r\n3:20-4:00	Work on homework assignment: make a student profile web page for a classmate.<br/> \r\n</p>\r\n<p>\r\nMy main goal for the session was to convey a certain mood for the lab (serious but experimental) and to provide an excuse for a “getting to know you” activity. By way of introducing students to digital making, I also wanted to establish a solid grounding in on web-based information gets stored, transferred, displayed. I’ve found the Codecademy tutorial to be an effective introduction to the subject matter I wanted everyone to understand in order to make profiles. Finally, the idea of the activity was to combine digital making skills with the process of meeting a classmate. \r\n</p>\";s:7:\"summary\";s:0:\"\";s:6:\"format\";s:9:\"full_html\";s:10:\"safe_value\";s:1688:\"<p>Topics covered included HTTP requests, basic HTML, basic CSS, and web design concepts. Synthesis with course took the form of a \"Getting to Know You\" activity.\n</p>\n<p>Juraj and I designed this class to meet from 12:50 to 2:20 Mon, Wed and reconvene for our digital lab from 2:30 to 4 on Wednesdays only. Classes began on Wednesday this semester, so our first day of class was a lab day. From 12:50 to 2:20, we did some stage setting but mainly spent the block talking about the syllabus, course policies, assignments, and all that good housekeeping material a conscientious teacher must address early and repeat often. As a result, we came to lab without much grasp on any of the course material.\n</p>\n<p>\nMy itinerary looked like this:\n</p>\n<p>\n2:30-2:50 <a href=\"http://www.slideshare.net/mjlavin80/html-45801099\">Slideshow</a> on the basics of protocols (HTTP, FTP, etc.), HTML, CSS<br /><br />\n2:50-3:20	Self-guided practice, Codecademy tutorial on “Building a Website” <br /><br />\n3:20-4:00	Work on homework assignment: make a student profile web page for a classmate.<br /></p>\n<p>\nMy main goal for the session was to convey a certain mood for the lab (serious but experimental) and to provide an excuse for a “getting to know you” activity. By way of introducing students to digital making, I also wanted to establish a solid grounding in on web-based information gets stored, transferred, displayed. I’ve found the Codecademy tutorial to be an effective introduction to the subject matter I wanted everyone to understand in order to make profiles. Finally, the idea of the activity was to combine digital making skills with the process of meeting a classmate.\n</p>\n\";s:12:\"safe_summary\";s:0:\"\";}}}s:11:\"field_image\";a:0:{}s:10:\"field_tags\";a:1:{s:3:\"und\";a:3:{i:0;a:1:{s:3:\"tid\";s:1:\"1\";}i:1;a:1:{s:3:\"tid\";s:1:\"2\";}i:2;a:1:{s:3:\"tid\";s:1:\"3\";}}}}',0,1426868323,1),('field:node:3','a:3:{s:4:\"body\";a:0:{}s:13:\"field_caption\";a:1:{s:3:\"und\";a:1:{i:0;a:3:{s:5:\"value\";s:84:\"Defoe in the pillory, 1862 line engraving by James Charles Armytage after Eyre Crowe\";s:6:\"format\";N;s:10:\"safe_value\";s:84:\"Defoe in the pillory, 1862 line engraving by James Charles Armytage after Eyre Crowe\";}}}s:11:\"field_image\";a:1:{s:3:\"und\";a:1:{i:0;a:13:{s:3:\"fid\";s:1:\"3\";s:3:\"uid\";s:1:\"2\";s:8:\"filename\";s:17:\"defoe-pillory.jpg\";s:3:\"uri\";s:28:\"public://defoe-pillory_0.jpg\";s:8:\"filemime\";s:10:\"image/jpeg\";s:8:\"filesize\";s:6:\"481999\";s:6:\"status\";s:1:\"1\";s:9:\"timestamp\";s:10:\"1426868430\";s:11:\"rdf_mapping\";a:0:{}s:3:\"alt\";s:0:\"\";s:5:\"title\";s:0:\"\";s:5:\"width\";s:4:\"1100\";s:6:\"height\";s:3:\"473\";}}}}',0,1426868430,1),('field:node:4','a:1:{s:4:\"body\";a:1:{s:3:\"und\";a:1:{i:0;a:5:{s:5:\"value\";s:1919:\"Jürgen Habermas famously described the culture of the early 1700s London coffeehouses as the spark that kindled the advent of modern democracy. Indeed, the last licensing act in England expired in 1695 and with it also the censorship of press. Within the next decade, London was flooded with newspapers and pamphlets that openly scrutinized practically all aspects of public, but also private life. They were read and discussed in coffeehouses that soon became social institutions of their own right. Yet, such idealized world of London coffeehouses also had another, much darker side. Daniel Defoe, who patronized them frequently, described them as places of scandal and depravity, infested with deception and the manipulation of information for commercial gain. Relying mainly on original newspaper articles, essays and pamphlets published in the 1705-1725 period by Addison, Steele and Defoe, the proposed course’s main goal is to help students mentally recreate the atmosphere of London at the down of what we call the Enlightenment era.\r\n\r\nThe digital humanities aspect of this course will build upon and extent the course’s topical focus on early modern London and the public sphere. Each week, students will gather in a collaborative lab setting to explore a digital humanities approach, toll or topic related to that week’s subject matter. Examples of these pairings include constructions of digital timelines; digital mapping strategies; the applications of open-source network analysis software; computational analysis that compares various styles and enables authorship attribution (stylometry). Students will gain technical skills and competencies unique to quantitative study of humanities subjects and materials, learn to understand and evaluate digital media, explore the limits of quantification, and address the social, ethical, legal, and philosophical implications of computing and technology.\";s:7:\"summary\";s:0:\"\";s:6:\"format\";s:13:\"filtered_html\";s:10:\"safe_value\";s:1931:\"<p>Jürgen Habermas famously described the culture of the early 1700s London coffeehouses as the spark that kindled the advent of modern democracy. Indeed, the last licensing act in England expired in 1695 and with it also the censorship of press. Within the next decade, London was flooded with newspapers and pamphlets that openly scrutinized practically all aspects of public, but also private life. They were read and discussed in coffeehouses that soon became social institutions of their own right. Yet, such idealized world of London coffeehouses also had another, much darker side. Daniel Defoe, who patronized them frequently, described them as places of scandal and depravity, infested with deception and the manipulation of information for commercial gain. Relying mainly on original newspaper articles, essays and pamphlets published in the 1705-1725 period by Addison, Steele and Defoe, the proposed course’s main goal is to help students mentally recreate the atmosphere of London at the down of what we call the Enlightenment era.</p>\n<p>The digital humanities aspect of this course will build upon and extent the course’s topical focus on early modern London and the public sphere. Each week, students will gather in a collaborative lab setting to explore a digital humanities approach, toll or topic related to that week’s subject matter. Examples of these pairings include constructions of digital timelines; digital mapping strategies; the applications of open-source network analysis software; computational analysis that compares various styles and enables authorship attribution (stylometry). Students will gain technical skills and competencies unique to quantitative study of humanities subjects and materials, learn to understand and evaluate digital media, explore the limits of quantification, and address the social, ethical, legal, and philosophical implications of computing and technology.</p>\n\";s:12:\"safe_summary\";s:0:\"\";}}}}',0,1426868755,1),('field:taxonomy_term:1','a:0:{}',0,1429283432,1),('field:taxonomy_term:2','a:0:{}',0,1429283432,1),('field:taxonomy_term:3','a:0:{}',0,1429283432,1),('field:user:0','a:0:{}',0,1427123439,1),('field:user:1','a:0:{}',0,1427118534,1),('field:user:2','a:0:{}',0,1426868345,1),('field_info:bundle:comment:comment_node_article','a:2:{s:9:\"instances\";a:1:{s:12:\"comment_body\";a:13:{s:5:\"label\";s:7:\"Comment\";s:8:\"settings\";a:2:{s:15:\"text_processing\";i:1;s:18:\"user_register_form\";b:0;}s:8:\"required\";b:1;s:7:\"display\";a:1:{s:7:\"default\";a:5:{s:5:\"label\";s:6:\"hidden\";s:4:\"type\";s:12:\"text_default\";s:6:\"weight\";i:0;s:8:\"settings\";a:0:{}s:6:\"module\";s:4:\"text\";}}s:6:\"widget\";a:4:{s:4:\"type\";s:13:\"text_textarea\";s:8:\"settings\";a:1:{s:4:\"rows\";i:5;}s:6:\"weight\";i:0;s:6:\"module\";s:4:\"text\";}s:11:\"description\";s:0:\"\";s:2:\"id\";s:1:\"3\";s:8:\"field_id\";s:1:\"1\";s:10:\"field_name\";s:12:\"comment_body\";s:11:\"entity_type\";s:7:\"comment\";s:6:\"bundle\";s:20:\"comment_node_article\";s:7:\"deleted\";s:1:\"0\";s:13:\"default_value\";N;}}s:6:\"fields\";a:1:{i:0;a:16:{s:12:\"entity_types\";a:1:{i:0;s:7:\"comment\";}s:12:\"translatable\";s:1:\"0\";s:8:\"settings\";a:0:{}s:7:\"storage\";a:5:{s:4:\"type\";s:17:\"fi