INSERT INTO `field_revision_body` VALUES ('node','digital_lab_article',0,1,1,'und',0,'<p>Topics covered included HTTP requests, basic HTML, basic CSS, and web design concepts. Synthesis with course took the form of a \"Getting to Know You\" activity.\r\n</p>\r\n<p>Juraj and I designed this class to meet from 12:50 to 2:20 Mon, Wed and reconvene for our digital lab from 2:30 to 4 on Wednesdays only. Classes began on Wednesday this semester, so our first day of class was a lab day. From 12:50 to 2:20, we did some stage setting but mainly spent the block talking about the syllabus, course policies, assignments, and all that good housekeeping material a conscientious teacher must address early and repeat often. As a result, we came to lab without much grasp on any of the course material. \r\n</p>\r\n<p>\r\nMy itinerary looked like this:\r\n</p>\r\n<p>\r\n2:30-2:50 <a href=\"http://www.slideshare.net/mjlavin80/html-45801099\">Slideshow</a> on the basics of protocols (HTTP, FTP, etc.), HTML, CSS<br/>\r\n2:50-3:20	Self-guided practice, Codecademy tutorial on “Building a Website” <br/>\r\n3:20-4:00	Work on homework assignment: make a student profile web page for a classmate.<br/> \r\n</p>\r\n<p>\r\nMy main goal for the session was to convey a certain mood for the lab (serious but experimental) and to provide an excuse for a “getting to know you” activity. By way of introducing students to digital making, I also wanted to establish a solid grounding in on web-based information gets stored, transferred, displayed. I’ve found the Codecademy tutorial to be an effective introduction to the subject matter I wanted everyone to understand in order to make profiles. Finally, the idea of the activity was to combine digital making skills with the process of meeting a classmate. \r\n</p>','','full_html'),('node','page',0,4,4,'und',0,'Jürgen Habermas famously described the culture of the early 1700s London coffeehouses as the spark that kindled the advent of modern democracy. Indeed, the last licensing act in England expired in 1695 and with it also the censorship of press. Within the next decade, London was flooded with newspapers and pamphlets that openly scrutinized practically all aspects of public, but also private life. They were read and discussed in coffeehouses that soon became social institutions of their own right. Yet, such idealized world of London coffeehouses also had another, much darker side. Daniel Defoe, who patronized them frequently, described them as places of scandal and depravity, infested with deception and the manipulation of information for commercial gain. Relying mainly on original newspaper articles, essays and pamphlets published in the 1705-1725 period by Addison, Steele and Defoe, the proposed course’s main goal is to help students mentally recreate the atmosphere of London at the down of what we call the Enlightenment era.\r\n\r\nThe digital humanities aspect of this course will build upon and extent the course’s topical focus on early modern London and the public sphere. Each week, students will gather in a collaborative lab setting to explore a digital humanities approach, toll or topic related to that week’s subject matter. Examples of these pairings include constructions of digital timelines; digital mapping strategies; the applications of open-source network analysis software; computational analysis that compares various styles and enables authorship attribution (stylometry). Students will gain technical skills and competencies unique to quantitative study of humanities subjects and materials, learn to understand and evaluate digital media, explore the limits of quantification, and address the social, ethical, legal, and philosophical implications of computing and technology.','','filtered_html');
/*!40000 ALTER TABLE `field_revision_body` ENABLE KEYS */;
UNLOCK TABLES;
commit;

