INSERT INTO `search_dataset` VALUES (1,'node',' digital lab week 1 html topics covered included http requests basic html basic css and web design concepts synthesis with course took the form of a getting to know you activity juraj and i designed this class to meet from 1250 to 220 mon wed and reconvene for our digital lab from 230 to 4 on wednesdays only classes began on wednesday this semester so our first day of class was a lab day from 1250 to 220 we did some stage setting but mainly spent the block talking about the syllabus course policies assignments and all that good housekeeping material a conscientious teacher must address early and repeat often as a result we came to lab without much grasp on any of the course material my itinerary looked like this 230250 slideshow on the basics of protocols http ftp etc html css 250320 selfguided practice codecademy tutorial on building a website 320400 work on homework assignment make a student profile web page for a classmate my main goal for the session was to convey a certain mood for the lab serious but experimental and to provide an excuse for a getting to know you activity by way of introducing students to digital making i also wanted to establish a solid grounding in on webbased information gets stored transferred displayed i ve found the codecademy tutorial to be an effective introduction to the subject matter i wanted everyone to understand in order to make profiles finally the idea of the activity was to combine digital making skills with the process of meeting a classmate http html css ',0),(3,'node',' defoe in the pillory defoe in the pillory 1862 line engraving by james charles armytage after eyre crowe  ',0),(4,'node',' course description jürgen habermas famously described the culture of the early 1700s london coffeehouses as the spark that kindled the advent of modern democracy indeed the last licensing act in england expired in 1695 and with it also the censorship of press within the next decade london was flooded with newspapers and pamphlets that openly scrutinized practically all aspects of public but also private life they were read and discussed in coffeehouses that soon became social institutions of their own right yet such idealized world of london coffeehouses also had another much darker side daniel defoe who patronized them frequently described them as places of scandal and depravity infested with deception and the manipulation of information for commercial gain relying mainly on original newspaper articles essays and pamphlets published in the 17051725 period by addison steele and defoe the proposed course s main goal is to help students mentally recreate the atmosphere of london at the down of what we call the enlightenment era the digital humanities aspect of this course will build upon and extent the course s topical focus on early modern london and the public sphere each week students will gather in a collaborative lab setting to explore a digital humanities approach toll or topic related to that week s subject matter examples of these pairings include constructions of digital timelines digital mapping strategies the applications of opensource network analysis software computational analysis that compares various styles and enables authorship attribution stylometry students will gain technical skills and competencies unique to quantitative study of humanities subjects and materials learn to understand and evaluate digital media explore the limits of quantification and address the social ethical legal and philosophical implications of computing and technology  ',0);
/*!40000 ALTER TABLE `search_dataset` ENABLE KEYS */;
UNLOCK TABLES;
commit;

